CREATE TABLE call_logs (
  caller_id INT,
  receiver_id INT,
  call_duration INT,
  call_timestamp TIMESTAMP
);

CREATE TABLE customer_behavior (
  customer_id INT,
  call_frequency INT,
  last_call_timestamp TIMESTAMP,
  call_duration_avg FLOAT
);

CREATE TABLE CallLogs (
  call_id UUID PRIMARY KEY,
  call_timestamp TIMESTAMP,
  caller_phone_number VARCHAR,
  call_duration INT
);

CREATE TABLE Customers (
  customer_id UUID PRIMARY KEY,
  customer_name VARCHAR,
  customer_phone_number VARCHAR UNIQUE,
  customer_email VARCHAR
);

CREATE TABLE CallPatterns (
  pattern_id UUID PRIMARY KEY,
  customer_id UUID,
  call_type VARCHAR,
  call_frequency INT
);

CREATE TABLE customers (
  customer_id INT PRIMARY KEY,
  name TEXT,
  email TEXT,
  phone_number TEXT
);

CREATE TABLE call_patterns (
  pattern_id INT PRIMARY KEY,
  call_type TEXT,
  average_duration INT
);

CREATE TABLE customer_behavior (
  behavior_id INT PRIMARY KEY,
  customer_id INT,
  behavior_description TEXT,
  behavior_date DATE
);

CREATE TABLE call_patterns (
    pattern_id UUID PRIMARY KEY,
    pattern_description TEXT,
    associated_customer_id UUID,
    occurrence_count INT
);

CREATE TABLE call_ratings (
    rating_id UUID PRIMARY KEY,
    call_id UUID,
    rating INT,
    feedback TEXT
);
